import { React, useState } from "react";

export const UseSate = () => {
  const [data, setData] = useState.details({ name: "", age: "", city: "" });
  return (
    <div>
      <input
        type="text"
        placeholder="Enter Name"
        onChange={(e) => setData.details.name(e.target.value)}
      />
      <input
        type="text"
        placeholder="Age"
        onChange={(e) => setData(e.target.value)}
      />
      <input
        type="text"
        placeholder="City"
        onChange={(e) => setData(e.target.value)}
      />

      <h4>Name:</h4>
      <h4>Age:</h4>
      <h4>city:</h4>
    </div>
  );
};
